import './App.js'
import createSudoku from './App.js'
import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
let sudoku=createSudoku()
const root=ReactDOM.createRoot(document.getElementById('root'));
class Start extends React.Component{
  constructor(){
    super()
  }
  func=()=>{
    root.render(<Sudoku arr={sudoku} />)
  }
  render(){
    return (<button className='startButton'onClick={this.func}>
      CLICK TO START
    </button>)
  }
}
class Sudoku extends React.Component{
     constructor(props)
     {
      super(props);
     }
     render(){
      return(
        this.props.arr.map((temp)=><div className='Sudoku'><Row arra={temp} row={'1'}/><br/></div>)
      )
     }
}
class Row extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return (
      this.props.arra.map((temp)=>
     { if(temp!==-1)
      return <Element val={temp}/>
      else
      return <Input row={this.props.row} />
     }))
  }
}
class Element extends React.Component{
  constructor(props)
  {
    super(props)
  }
  render(){
    return (
      <div className='Element'>
        {this.props.val}
      </div>
    )
  }
}
class Input extends React.Component{
  constructor(props){
    super(props);
    this.state={"row":this.props.row}
  }
  func=(e)=>{
    let v=e.target.value
    alert(v);
  }
  render(){
    return (
      <input type="text"  className="Element1" onKeyDown={this.func}/>
    )
  }
}
root.render(<Start/>)
